INSERT INTO `configs` VALUES (1,'СКОРО ОТКРЫТИЕ!!!','logo.png',3519,'45-65-75','Прокат инструмента и строительного оборудования в Магнитогорске','У нас Вы всегда сможете взять в аренду любой нужный Вам инструмент и будете уверены, что он будет в исправном состоянии и выполнит свои функции на все 100%','<p style=\"text-align: center;\">Мы рады видеть Вас на нашем сайте!</p>\n<p>На нашем сайте Вы сможете подробно изучить то как мы работаем.</p>\n<p>&nbsp;</p>\n<p>На самом деле все очень просто:</p>\n<p>1. Вам понадобилось какое либо строительное оборудование или инструмент ( перфоратор, дрель, лестница, строительные леса, генератор и т.д...). Вам совсем необязательно все это преобретать!</p>\n<p>2. Звоните нам или отправляете заказ к нам на почту <a href=\"mailto:prokatf@mail.ru\">prokatf@mail.ru</a>&nbsp;( форма заявки любая, можно написать такой текст: Добрый день! Хочу дома повесить полку, привезите мне перфоратор и шуруповерт. Жду! &nbsp;адрес (...), тел.(...)).</p>\n<p>3. Мы с Вами связываемся и обсуждаем Ваш заказ.</p>\n<p>4. Далее мы оформяем сделку ( у нас на базе&nbsp;или по адресу доставки), заключаем с Вами договор аренды, получаем от Вас оплату и залог.&nbsp;</p>\n<p>5. Вот в принцепе и все))) После Вы просто сдаете нам оборудование и забираете залог обратно.</p>\n<p>&nbsp;</p>\n<p>Пишите, звоните)))</p>','<p>&nbsp;</p>\n<p>Наша организация занимаеца предоставлением инструмента в аренду от молотка до крупногобаритной техники.</p>\n<p>Так же мы можем предоставлять и оператора с техникой &nbsp;</p>','<p style=\"text-align: center;\"><strong>Основные правила и условия предоставления инструмента в прокат.</strong></p>\n<ul>\n<li style=\"text-align: left;\">Пункт проката инструментов выдает строительные инструменты &nbsp;только при предъявлении Арендатором российского паспорта.&nbsp;Лицам без регистрации или зарегистрированным в жилых помещениях временного найма (общежитиях), а также в садовых товариществах всех типов строительные инструменты предоставляются под залог полной стоимости оборудования</li>\n<li style=\"text-align: left;\">При оформлении договора Арендатор обязан сообщить номер своего личного телефона , адрес фактического проживания и иные сведения о себе , запрашиваемые сотрудниками проката. &nbsp;При отказе Арендатора предоставить данные сведения &nbsp;договор проката заключается только при внесении Арендатором &nbsp;полной залоговой стоимости выдаваемого в прокат оборудования.&nbsp;</li>\n<li style=\"text-align: left;\">Арендатор оплачивает стоимость проката инструмента за предполагаемое время его использования (в сутках). Минимальный срок проката &ndash; один рабочий день (смена). Инструмент считается сданным в прокат на один рабочий день (смену), если прошло более двух часов с момента взятия инструмента.</li>\n<li style=\"text-align: left;\">Инструменты, взятые в прокат на срок более 30 суток, &nbsp;необходимо сдавать в пункт проката по истечении каждых &nbsp;30 суток для проведения профилактики (ТО). В противном случае расходы на ремонт инструмента будут осуществляться за счет Арендатора.</li>\n<li style=\"text-align: left;\">Час према оборудованиея с 11:00 до 12:00. После 12:00 начинаеюца следующие сутки аренды. Другое время сдачи возможно по согласованию с нами и прописание данной договоренности в договоре аренды.</li>\n<li style=\"text-align: left;\">При аренде оборудования с оперетором ответственность за оборудование несет оператор.&nbsp;</li>\n</ul>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><strong>Порядок использования расходных материалов.</strong></p>\n<ul>\n<li style=\"text-align: left;\">Невосстанавливаемые расходные материалы &ndash; алмазные и абразивные диски, цепи, наждачная бумага, абразивные сегменты, скобы, пилки и т.п. &nbsp;- покупаются Арендатором по ценам прейскуранта и возврату не подлежат.</li>\n<li style=\"text-align: left;\">В случае выдачи напрокат только расходных материалов (сверла, буры, алмазные диски, пильные цепи, диски и т.п.) Арендатор оплачивает их залоговую стоимость и арендную плату.</li>\n<li style=\"text-align: left;\">Если расходные материалы выдаюца с оборудованием ( например бур) залоговая стоимость не вносица, оплачиваеца только аренда.</li>\n</ul>\n<p style=\"text-align: center;\"><strong>Обязательства сторон.</strong></p>\n<ul>\n<li style=\"text-align: left;\">Оформить и подписать договор аренды, а также акт према/передачи.&nbsp;</li>\n<li style=\"text-align: left;\">Сотрудник пункта проката при выдаче и возврате инструмента в присутствии &nbsp;Арендатора проверяет исправность и комплектность инструмента, отсутствие механических повреждений корпуса, демонстрирует режим и порядок работы с инструментом на холостом ходу. А так же проводит краткий инструктаж о порядке и правилах использования инструмента.</li>\n<li style=\"text-align: left;\">Оплатить аренду инструмента в полном объеме за то время на которое данное оборудование береца. Своевременно сдать оборудование.</li>\n<li style=\"text-align: left;\">Прием и сдача оборудования производица только в чистом и полностью виде.</li>\n</ul>\n<p style=\"text-align: center;\"><strong>Обязательства при поломке инструмента.</strong></p>\n<ul>\n<li style=\"text-align: left;\">Пункт проката инструментов несет ответственность в случаях если инструмент выходит из строя сам.</li>\n<li style=\"text-align: left;\">При сдаче неисправного инструмента определяеца причина поломки по согласованию с Арендатором на месте ( на нашей базе) или в организации по сервисному обслуживанию и ремонту &nbsp;инструментов (данная услуга платная).&nbsp;Арендатор оплачивает ремонт инструмента в случаях если его действия привели к поломке оборудования. Оплата ремонта (востановления) производица в полном объеме включая арендные платежи дней ремонта.&nbsp;</li>\n</ul>\n<p style=\"text-align: left;\">P.S: Как показывает практика Арендатор виноват только в тех случаях когда оборудование использовалось не по назначению или же в не подходящих условиях. &nbsp;</p>\n<p style=\"text-align: left;\">&nbsp;</p>',2015,1,1,'2016-09-24 04:44:45','4276 8720 7677 2764 (Сбербанк)','prokatf@mail.ru','г. Магнитогорск, ул. Первая, дом 1 строение 12','<p>На этой странице Вы можете ознакомиться с тарифими на прокат инструмента</p>\n<p>&nbsp;</p>\n<table style=\"width: 584px; margin-left: auto; margin-right: auto; height: 194px;\" border=\"1\" cellspacing=\"5\" cellpadding=\"5\"><caption>\n<p>Тарифы</p>\n</caption>\n<tbody>\n<tr style=\"height: 13px;\">\n<td style=\"width: 101px; height: 13px;\">&nbsp;Инструмент</td>\n<td style=\"width: 154px; height: 13px;\">&nbsp;Срок аренды</td>\n<td style=\"width: 125px; height: 13px;\">Стоимость</td>\n<td style=\"width: 131px; height: 13px;\">&nbsp;Сумма залога</td>\n</tr>\n<tr style=\"height: 13px;\">\n<td style=\"width: 101px; height: 13px;\">&nbsp;Дрель</td>\n<td style=\"width: 154px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 125px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 131px; height: 13px;\">&nbsp;</td>\n</tr>\n<tr style=\"height: 13px;\">\n<td style=\"width: 101px; height: 13px;\">&nbsp;Перфоратор</td>\n<td style=\"width: 154px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 125px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 131px; height: 13px;\">&nbsp;</td>\n</tr>\n<tr style=\"height: 13px;\">\n<td style=\"width: 101px; height: 13px;\">Шуруповерт&nbsp;</td>\n<td style=\"width: 154px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 125px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 131px; height: 13px;\">&nbsp;</td>\n</tr>\n<tr style=\"height: 13px;\">\n<td style=\"width: 101px; height: 13px;\">Фрезер</td>\n<td style=\"width: 154px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 125px; height: 13px;\">&nbsp;</td>\n<td style=\"width: 131px; height: 13px;\">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>','2017-01-10 07:50:36');
