INSERT INTO `positions` VALUES (2,'Фрезер кромочный Bosch GKF 600','Bosch GKF 600 - практичный и компактный фрезер для обработки кромок. Оснащен шкалой и регулировочным колесиком для точной и плавной регулировки необходимой глубины захода. Компактная и эргономичная форма обеспечивает правильное ведение инструмента одной рукой, а обширный ассортимент принадлежностей в прочном кейсе позволяет решать различные задачи по обработке.','0.00','0.00',0,291,1,'2016-09-22 16:05:16'),(4,'Ручной перфоратор Bosch GBH 2-24 D','Высококлассный перфоратор Bosch GBH 2-24 D предназначен для самых тяжелых работ. Он способен быстро справиться с работой благодаря высокой скорости вращения сверла и производительному режиму долбления. Мощность двигателя составляет 790 Вт и позволяет развить энергию удара в 2.7 Дж. Срок службы инструмента увеличен за счет грамотной конструкции изделия и высококачественных материалов, из которых он изготовлен. Перфоратор оснащен системой блокировки для различных режимов работы. При выполнении работ по долблению бетона блокируется вращение, а при сверлении – удар. Предохранительная муфта обезопасит оператора и инструмент от повреждений при заклинивании бура в материале. Высвободить застрявшее сверло или бур можно благодаря наличию режима реверса, позволяющего также использовать данный инструмент при работе с крепежом в качестве шуруповерта. Bosch GBH 2-24 D, несмотря на свою принадлежность к инструментам профессионального уровня, предлагается по вполне приемлемой цене.','0.00','0.00',0,287,1,'2016-09-22 17:39:50'),(6,'Фен технический Интерскол ФЭ-2000','Технический фен, используется для обработки горячим воздухом различной температуры поверхностей и материалов, для разогрева машин и механизмов, для обеззараживания поверхности, для растопки мангалов, для пайки и сварки пластиков, напольных покрытий, для тонировки стекол.\n\nПреимущества:\n-три режима работы с разной производительностью и температурой;\n-многоразовый термопредохранитель;\n-плавная регулировка внутри каждого режима работы;\n-удобная форма, для установки фена вверх соплом;\n-набор насадок и скребок в комплекте;\n-удобный кейс для хренения инструмента и приспособлений.','0.00','0.00',0,285,1,'2016-10-03 17:06:23');
